class Solution(object):
    def findPrimePairs(self, n):
        def sieve(n):
            prime = [True] * (n+1)
            p = 2
            while (p * p <= n):
                if (prime[p] == True):
                    for i in range(p * 2, n+1, p):
                        prime[i] = False
                p += 1
            return [p for p in range(2, n) if prime[p]]

        primes = sieve(n)
        result = []
        primes_set = set(primes)
        for x in primes:
            y = n - x
            if y in primes_set and x <= y:
                result.append([x, y])
        return result
